import React, { useState, useEffect } from 'react';
import './Header.css';
import Person from '../../Image/blankUser.png'

const Header = (props) => {
    const changeState = (event) =>{
        console.log(event.target)
    }


    let hdrValues = [
        {
            name: "Home",
            value: "home"
        },
        {
            name: "Teaching",
            value: "teaching"
        },
        {
            name: "Resume",
            value: "resume"
        },
        {
            name: "Contact",
            value: "contact"
        },
    ]
    let hdrButtons = []
    for (let i = 0; i < hdrValues.length; i++) {
        hdrButtons.push(
            <button 
                className="HeaderButton"
                value="peen"
                onClick = {changeState}>
                {hdrValues[i].name}
            </button>
        )
    }


    return (
        <div className="HeaderContainer">
            <div>
                <h1>Aubree Herrin - PhD</h1>
                <div className="HeaderButtonContainer">
                    {hdrButtons}
                </div>
            </div>

        </div>
    );




}
export default Header;
